import * as React from "react";
import { Card, CardContent, CardHeader } from '@material-ui/core';
import {DashChart} from '../components'

function getTimestampFirstDayInThisMonth() {
    var date = new Date();
    return date.toLocaleDateString();
}

export default () => (
    <Card>
        <CardHeader title="Welcome to the administration" />
        <CardContent>Number of notifications per day this month ({getTimestampFirstDayInThisMonth()}): </CardContent>
        <DashChart />
        <br />
        <CardContent>Number of notifications per day this month :</CardContent>
        <DashChart />
    </Card>
);
